    false,nt"url": null,nt"notes": "The number and distribution of birds near
    a barrier island west of Prudhoe Bay, Alaska, were recorded during the summer of
    1972. Eiders fed and rested in the open area of water in spring migration but during
    late summer. Old Squaws and red phalarope congregated near the island during late
    summer. Human disturbance during nesting season is a factor. Lagoons are important
    areas for post - breeding concentrations of birds and should be protected.",nt"owner_org":
